import React from "react";
import "./homenav.css";
import logo from "../img/homelogo.png";
import { Link } from "react-router-dom";
 function Homenav(){
    return(
        <>
         <nav>
          <Link>
          <div className="homelogo">
         <img src={logo}/>
         </div>
          </Link>
          
         

         </nav>
        </>
    );
 }
 export default Homenav;
